text:
@shekharnaughty राजर्षि - अपाच्य नै छ ।
ऐय्यासी - यत्तिको पचाइदिन पर्छ ! यसको कैयौँ गुना त पचाइसकिएको हो यिनका चुरीफुरी !
सादगी - राजतन्त्रको समर्थक नभइकन नै संग्रहालयमा खाटलगायतका सामान देख्दा सादगीको प्रशंसक हुँ म ।

@only_mukhiyaa2 @GThapa25 ज्ञानेन्द्र शाही  र रामकुमारी झाक्री 
गगन र महेश ।
नाम फरक व्यक्ति फरक पार्टी फरक होला तर सिद्दान्त अनि  चरित्र भने एकै हो ।यस्ता पात्र हरु घोर अवसरबादी हुन्छन् त्यसका खातिर उनीहरू जुन सुकै भूमिका पनि निर्वाह गर्छन् गरेकै छन् गरिरहने छन् ।चिन्न पर्यो नि हलेदो हो कोटायाई रहनु पर्छ

